import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import ComplexGrid from './pagetwo';

export default function Labtabs() {
  const [value, setValue] = React.useState('1');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%', typography: 'body1', backgroundColor: '#808080', minHeight: '100vh', padding: 2 }}>
      <Box sx={{ textAlign: 'center', paddingBottom: 2 }}>
        <Box component="h1" sx={{ color: 'blue' }}>
          NOTIFIKASI
        </Box>
      </Box>
      <TabContext value={value}>
        <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
          <TabList onChange={handleChange} aria-label="lab API tabs example">
            <Tab label="Semua" value="1" />
            <Tab label="Belum Terbaca" value="2" />
            <Tab label="Sudah Terbaca" value="3" />
          </TabList>
        </Box>
        <TabPanel value="1">
          <div><ComplexGrid /></div>
        </TabPanel>
        <TabPanel value="2">
          <div><ComplexGrid /></div>
        </TabPanel>
        <TabPanel value="3">
          Item Three
        </TabPanel>
      </TabContext>
    </Box>
  );
}
